import axios from "axios";

 const api = axios.create({
   baseURL: "http://localhost:3001/api/data",
});

export const GetData = async (data) => {
   await api.get(`/`, {
       headers: {
       },
    }).then((data)=> {
        const sorted = data.data.sort((a, b) => {
            // Convert the timestamps to Date objects for comparison
            const timestampA = new Date(a.timestamp);
            const timestampB = new Date(b.timestamp);
            // Compare the timestamps
            if (timestampA < timestampB) return -1; // a should come before b
            if (timestampA > timestampB) return 1; // a should come after b
            return 0; // timestamps are equal
          });
          return sorted
    })
 };
